import React, { useState } from 'react'
import {MdOutlineNavigateBefore,MdOutlineNavigateNext} from "react-icons/md"

const reklamDta=[
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
]
const Reklam = () => {
    const [reklam,setReklam]=useState(1)
    const before=()=>{
        if(reklam===1){
            setReklam(reklam)
        }else{
            setReklam(reklam-1)
        }
    }
    const after=()=>{
        if(reklam===3){
            setReklam(reklam)
        }else{
            setReklam(reklam+1)
        }

    }
    
  return (
    <div className='reklam'>
        <div className="reklam_img">
            <img className='rek_img' src={reklamDta[reklam-1]} alt="" />
        </div>
        <div className="next">
            <MdOutlineNavigateBefore onClick={()=>before()} className='reklam_icons'/>
            <MdOutlineNavigateNext onClick={()=>after()} className='reklam_icons'/>
        </div>
    </div>
  )
}

export default Reklam